import React from "react";
import MainGrid from "./MainGrid"
import useVisualMode from "./hooks/useVisualMode";
import Bio from "./Bio"
import Charlie from "./Charlie"
import Projects from "./Projects"
import Skills from "./Skills"
import Education from "./Education"


export default function Menu() {
  const MENU = "MENU";
  const BIO = "BIO";
  const CHARLIE = "CHARLIE";
  const PROJECTS = "PROJECTS";
  const SKILLS = "SKILLS";
  const EDUCATION = "EDUCATION";

  const { mode, transition } = useVisualMode(MENU);

  return (
<article>
{mode === MENU && <MainGrid transition={transition}/>}
{mode === BIO && <Bio transition={transition}/>}
{mode === CHARLIE && <Charlie transition={transition}/>}
{mode === PROJECTS && <Projects transition={transition}/>}
{mode === SKILLS && <Skills transition={transition}/>}
{mode === EDUCATION && <Education transition={transition}/>}
</article>



  );
}
